import { Container, Card } from "react-bootstrap";

const Home = () => {
  return (
    <>
      {/* <Container> */}
        <Card className="m-4" style={{color:'black'}}>
          <h1>
            <b>Neo</b>
            <span>
              <b className="text-danger">Store</b>
            </span>
          </h1>
        </Card>
      {/* </Container> */}
    </>
  );
};

export default Home;
